import binascii

# 你提供的数据样本
encrypted_data = ""

# 转换为字节
data_bytes = binascii.unhexlify(encrypted_data)

print(f"数据长度: {len(data_bytes)} 字节")
print(f"前50字节: {data_bytes[:50].hex()}")

# 尝试寻找模式
print("\n分析数据模式...")
for i in range(min(10, len(data_bytes) // 20)):
    chunk = data_bytes[i*20:(i+1)*20]
    print(f"块 {i}: {chunk.hex()}")